(972, 'война россия черный', 'o2CRJGztCjQ', 'https://i.ytimg.com/vi/o2CRJGztCjQ/hqdefault.jpg', 'Война России и Китая не за горами', 'Подробнее:http://t.co/uB3QeU985d ПОРАЖЕНИЯ РОССИЙСКОЙ АРМИИ - http://t.co/PKKZAsxMeP Как кавказцы обложили данью офицеров флота...'),
